import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
//style importer
import * as style__ from "./style";
//component importer
//utils importer
interface Props {
  // isFormDisPlay: (status: boolean) => void;
  // stateUser: boolean;
}
type State = typeof initState;

const initState = {
  status: false as boolean,
};
export default class RegisterForm extends Component<Props, State> {
  state = initState;

  formDisplay = () => {
    // this.props.isFormDisPlay(!this.props.stateUser);
  };

  formRegisterDisplay = (status: boolean) => {
    this.setState({
      status,
    });
  };

  formRegister = () => {
    return (
      <Route path="/register">
        <div
          style={{
            position: "absolute",
            top: "50%",
            left: "50%",
            transform: "translate(-50%,-50%)",
          }}
        >
          <form action="">
            <label>
              {"Họ và tên:"}
              <input type="text" />
            </label>

            <label>
              {"CMND: "}
              <input type="text" />
            </label>

            <label>
              {"Ngày sinh: "}
              <input type="text" />
            </label>

            <label>
              {"Giới tính: "}
              <input type="text" />
            </label>

            <label>
              {"Địa chỉ: "}
              <input type="text" />
            </label>

            <label>
              {"Số điện thoại: "}
              <input type="text" />
            </label>

            <label>
              {"Email: "}
              <input type="text" />
            </label>

            <label>
              {"Password: "}
              <input type="password" />
            </label>

            <span onClick={() => this.formRegisterDisplay(!this.state.status)}>
              Đăng ký
            </span>

            <span onClick={this.formDisplay}>Cancel</span>
          </form>
        </div>
      </Route>
    );
  };

  render() {
    return <React.Fragment>{this.formRegister()}</React.Fragment>;
  }
}
